/* eslint-disable no-use-before-define */
import React from "react";
import TextField from "@material-ui/core/TextField";
import { makeStyles, createStyles } from "@material-ui/core/styles";
import Autocomplete from "@material-ui/lab/Autocomplete";
import Paper from '@material-ui/core/Paper';
import InputBase from '@material-ui/core/InputBase';
import IconButton from "@material-ui/core/IconButton";
import SearchIcon from "@material-ui/icons/Search";

const searchData = ['Salem Community Fridge', 'Salisbury Fridge', 'Sheffield Fridge', 'Springfield Community Fridge', 'Somerville Community Fridge', 'Somerset Community Fridge', 'Southampton Fridge', 'Southwick Fridge', 'South End Fridge', 'South Hadley Community Fridge']

const useStyles = makeStyles((theme) =>
  createStyles({
    root: {
      padding: "2px 4px",
      display: "flex",
      alignItems: "center",
      width: 400,
    },
    input: {
      marginLeft: theme.spacing(1),
      flex: 1,
    },
    iconButton: {
      padding: 10,
    },
    divider: {
      height: 28,
      margin: 4,
    },
  })
);

export default function FreeSolo() {
  const classes = useStyles();
  return (
    <Autocomplete
      freeSolo
      id="free-solo-2-demo"
      disableClearable
      options={searchData}
      renderInput={(params) => (
        <Paper className={classes.root}>
          <InputBase
          {...params}
            className={classes.input}
            placeholder="Search"
            inputProps={{ ...params.InputProps, type: 'search' }}
          />
          <IconButton
            type="submit"
            className={classes.iconButton}
            aria-label="search"
            color="primary"
          >
            <SearchIcon />
          </IconButton>
        </Paper>
      )}
    />
  );
}
